const PropertiesHeader = () => {
    return (
        <div className="properties-header-row">
            <div className="properties-header-cell">Hero</div>
            <div className="properties-header-cell">Gender</div>
            <div className="properties-header-cell">Attribute</div>
            <div className="properties-header-cell">Role(s)</div>
            <div className="properties-header-cell">Side</div>
            <div className="properties-header-cell">Range Type</div>
            <div className="properties-header-cell">Complexity</div>
        </div>
    );
};

export default PropertiesHeader;
